/*! Load in WFS */
var wfs = new Dexie("wfs");
wfs.version(1).stores({
    files: "path, data",
    folders: "path"
});
/*! Load Kernel Functions */
function blueScreen(error) {
    $('body').attr('style','');
    $('body').css({'background-color':'blue','font-family':'Courier','color':'white'});
    $('body').html('Webdows (c) 2015 - 2016<br><br>A problem has been detected and Webdows has been halted.<br><br>If this is the first time you\'ve seen this error screen, refresh your browser. If this screen appears again, follow these steps:<br>Check to make sure any new software is properly written (HTTP errors, syntax errors, ect). If problems continue, disable or remove any newly installed software.<br><br>Technical information:<br><br>');
    $('body').append(error);
}
function boot() {
    $(document).ready(function() {
        $('body').attr('style','');
        $('body').html('');
        $('body').css({'background-color':'black','color':'white','font-size':'20px','font-family':'Trebuchet MS','text-align':'center','padding-top':'10%'});
        $('body').append('<img width="200" height="200" src="webdows/resources/kernel/wsa.gif"><br>');
        $('body').append('Starting Webdows<br><span style="font-size:15px;color:lightgray;">&copy;Below Average</span>');
    });
    $('title').text('Webdows');
    $.getScript('webdows/system32/shell.js').done(function() {
        $.getScript('webdows/explorer.js').done(function() {
            $.getScript('startup.js');
        });
    });
}
$(document).ajaxError(function(event, jqxhr, settings, thrownError) { //Error Handle
    if(typeof explorer !== 'undefined') { //Test if explorer is loaded
        var errorWin = new explorer.window()
        .center()
        .title('System Error')
        .icon('webdows/resources/icons/aler.ico')
        .body
        .html('The file: '+settings.url+', Has thrown the following error...<br><br>'+thrownError)
        .css({'padding':'10px'});
    } else {
        if(thrownError == 'Not Acceptable') {
            blueScreen('A recent system call to "'+settings.url+'" has failed due to the method not existing...<br><br>'+thrownError);
        } else if(thrownError == 'Not Found') {
            blueScreen('A recent file request to "'+settings.url+'" has failed due to the file not existing...<br><br>'+thrownError);
        } else {
            blueScreen('SYSTEMHALT @ '+settings.url+'<br><br>'+thrownError);
        }
    }
});
var system = {
    formatAMPM : function(date) {
        var hours = date.getHours();
        var minutes = date.getMinutes();
        var ampm = hours >= 12 ? 'PM' : 'AM';
        hours = hours % 12;
        hours = hours ? hours : 12;
        minutes = minutes < 10 ? '0'+minutes : minutes;
        var strTime = hours + ':' + minutes + ' ' + ampm;
        return strTime;
    },
    is : {
        mobile : function() {
            var ret = false;
                if(typeof window.orientation !== 'undefined'){
                    ret = true;
                }
            return ret;
        }
    },
    guid : function() {
        function s4() {
            return Math.floor((1 + Math.random()) * 0x10000).toString(16).substring(1);
        }
        return s4()+s4()+'-'+s4()+'-'+s4()+'-'+s4()+'-'+s4()+s4()+s4();
    },
    loader : function(path) {
        $.ajax({
            type: "GET",
            url: path,
            dataType: "script",
            cache: true
        });
    },
    file : function(location) {
        location = location.replace(/\/+/g, '/');
        var arr = location.split(/[\/]/);
        this.name = arr.pop();
        $.each(arr, function(k, v) {
            arr[k] = $.trim(v);
            if(arr[k] == '') {
                arr.splice(k, 1);
            }
        });
        if(this.name == '') {
            this.name = arr.pop();
            this.type = 'folder';
        } else {
            this.type = 'file';
        }
        this.rawPath = arr;
        var path = arr.join('/');
        if(path == '') {
            this.path = '';
        } else {
            this.path = path+'/';
        }
        if(this.type == 'file') {
            this.fullPath = this.path+this.name;
        } else {
            this.fullPath = this.path+this.name+'/';
        }
        this.create = function() {
            wfs.open();
            var epath = '';
            $.each(this.rawPath, function(k, v) {
                epath = epath+v+'/';
                wfs.folders.put({'path': epath});
            });
            if(this.type == 'file') {
                wfs.files.add({'path':this.fullPath, 'data': null});
            }
            if(this.type == 'folder') {
                wfs.folders.add({'path':this.fullPath});
            }
            wfs.close();
            return this;
        };
        this.write = function(data) {
            wfs.open();
            if(this.type == 'file') {
                wfs.files.put({'path': this.fullPath, 'data': data});
            }
            wfs.close();
            return this;
        };
        this.read = function(callback) {
            wfs.open();
            if(this.type == 'file') {
                wfs.files.get(this.fullPath, function(item){ this.data = item.data; callback.call(this); });
            }
            wfs.close();
            return this;
        };
        this.delete = function() {
            wfs.open();
            if(this.type == 'file') {
                wfs.files.delete(this.fullPath);
            }
            if(this.type == 'folder') {
                wfs.files.where('path').startsWith(this.fullPath).eachKey(function(k) {
                    wfs.files.delete(k);
                });
                wfs.folders.where('path').startsWith(this.fullPath).eachKey(function(k) {
                    wfs.folders.delete(k);
                });
            }
            wfs.close();
            return this;
        };
        this.list = function(callback) {
            wfs.open();
            
            wfs.close();
            return this;
        };
        this.rename = function(newname) {
            wfs.open();
            
            wfs.close();
            return this;
        };
        return this;
    }
};
boot();